import React, { Component } from 'react';
import './HomePage.css'




class HomePage extends Component {

	onClick = () => {
		this.props.onRouteChange('blayout')
	}
    render()
    {
    		return(
    	<div className = 'container'>
    		   <div className = 'nav'>
    		      <div className = 'content'>
    		   </div>
    		   <div className = 'logo'>
    		       <img onClick = {this.props.onRouteChange} className = 'logo--logo grow' src = 'https://i.ibb.co/z40W7GY/logo.png' />
    		   </div>


		       </div>
		<div className = 'home'>

				<div className = 'coments'>

				</div>		
				<div className = 'turns'>

				</div>
	    </div>
     </div>


		);
    }




}

export default HomePage;
